import React from 'react'
import Card from './Card';
import Data from './Data'
const Review = () => {
    return (
        <>
            <section className="mt-5">
                <div className="container">
                    <div className="row">
                            <Card
                                imgsrc = {Data[0].imgsrc}
                                title = {Data[0].title}
                            />
                            <Card
                                imgsrc = {Data[1].imgsrc}
                                title = {Data[1].title}
                            />
                            <Card
                                imgsrc = {Data[2].imgsrc}
                                title = {Data[2].title}
                            />
                            <Card
                                imgsrc = {Data[1].imgsrc}
                                title = {Data[1].title}
                            />
                            <Card
                                imgsrc = {Data[1].imgsrc}
                                title = {Data[1].title}
                            />
                    </div>
                </div>
            </section>  
        </>
    )
}
export default Review;
